document.getElementById('generatePDF').addEventListener('click', function() {
    const {
        jsPDF
    } = window.jspdf;
    const doc = new jsPDF({
        orientation: 'landscape'
    });

    // URL o base64 de la imagen que deseas usar como fondo
    const imgData = 'data:image/png;base64,';

    // Dibuja la imagen de fondo antes de generar la tabla
    doc.addImage(imgData, 'JPEG', 50, 10, 180, 180); // Ajusta las coordenadas y el tamaño según sea necesario

    doc.text("REPORTE DE PAGOS", 140, 10, {
        align: 'center'
    });

    const table = document.querySelector("#dataTable");

    doc.autoTable({
        html: table,
        startY: 20,
        theme: 'grid',
        headStyles: {
            fillColor: [16, 67, 116]
        },
        alternateRowStyles: {
            fillColor: [240, 240, 240]
        },
        styles: {
            cellPadding: 3,
            fontSize: 8,
            valign: 'middle',
            overflow: 'linebreak',
            tableWidth: 'wrap'
        },
        head: [
            ['FECHA DE PAGO', 'CÓDIGO DE OPERACIÓN', 'NÚMERO DE COMPROBANTE', 'TIPO DE PAGO', 'MONTO', 'OBSERVACIÓN']
        ],
        didParseCell: function(data) {
            // Verifica si la celda pertenece al tfoot
            if (data.section === 'foot') {
                // Establece el color de fondo a blanco para las celdas en tfoot
                data.cell.styles.fillColor = [16, 67, 116];


            }
        }
    });

       // Obtener la fecha actual en formato adecuado
       const today = new Date();
       const dateStr = today.toISOString().slice(0, 10); // Formato YYYY-MM-DD
   
       // Formatear la fecha y añadirla al PDF
       const dateString = today.toLocaleString();
       doc.setFontSize(10);
       doc.text(dateString, 10, doc.internal.pageSize.getHeight() - 10);

    // Guardar el PDF con el nombre que incluye la fecha actual
    doc.save(`reporte_pagos_${dateStr}.pdf`);
});